// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "./interface/IERC20.sol";
import "./interface/ICompound.sol";
import "./interface/IPool.sol";

contract Pool is IPool {
    address[] public participants;
    mapping (address => uint256) public balances;

    uint256 private constant MAX_INT = 2**256 - 1;

    // pool details
    uint256 public startDate;
    uint256 public participationEndDate;
    uint256 public endDate;
    uint256 public participationAmount;

    // If set the pool is the lottery pool
    address public winner;
    uint256 public bonus;
    bool public liquidated;

    uint256 public poolBalance;

    IERC20 public poolToken;
    ICompound public tokenCompound;

    address private _owner;

    bool private initialized;
    bool override public isLottery;

    modifier onlyOwner() {
        require(_owner == msg.sender, "NotOwnable");
        _;
    }

    function owner() public view virtual returns (address) {
        return _owner;
    }

    function initialize(address token_, address compound_, uint256 startDate_, uint256 participationEndDate_, 
        uint256 endDate_, uint256 participationAmount_, bool isLottery_) override external {
        require(!initialized, "AlreadyInitialized");
        require(endDate_ > participationEndDate_ && participationEndDate_ > startDate_, "InvalidDate");
        require(participationAmount_ != 0, "InvalidAmount");

        poolToken = IERC20(token_);
        tokenCompound = ICompound(compound_);

        _owner = msg.sender;

        if (address(tokenCompound) != address(0)) {
            poolToken.approve(address(tokenCompound), MAX_INT);
        }

        startDate = startDate_;
        participationEndDate = participationEndDate_;
        endDate = endDate_;
        participationAmount = participationAmount_;
        initialized = true;
        isLottery = isLottery_; 
    }

    function participate(address user) external onlyOwner override {
        require(block.timestamp >= startDate, "NotStarted");
        require(block.timestamp <= participationEndDate, "ParticipationDateEnded");
        require(balances[user] == 0, "AlreadyUser");

        poolToken.transferFrom(user, address(this), participationAmount);

        poolBalance += participationAmount;

        if (address(tokenCompound) != address(0)) {
            tokenCompound.mint(participationAmount);
        }

        participants.push(user);
        balances[user] = participationAmount;
    }

    function liquidateWithWinner(uint256 index) external onlyOwner override {
        require(isLottery, "NotLottery");
        require(winner == address(0), "WinnerAlreadySelected");
        uint256 poolSize = participants.length;
        require(index < poolSize, "InvalidIndex");

        _liquidate();

        // Give bonus to the winner
        winner = participants[index];
        balances[winner] += bonus;
        bonus = 0;
    }

    function liquidate() external onlyOwner override {
        require(!isLottery, "Lottery");

        _liquidate();

        // Split bonus among all the participants
        bonus /= participants.length;
    }

    function _liquidate() private {
        require(block.timestamp > endDate, "NotEnded");
        require(!liquidated, "Liquidated");

        liquidated = true;

        if (address(tokenCompound) != address(0)) {
            uint256 compoundBalance = tokenCompound.balanceOf(address(this));
            if (compoundBalance != 0) {
                require(0 == tokenCompound.redeem(compoundBalance), "CompoundError");
            }
        }
        bonus = poolToken.balanceOf(address(this)) - poolBalance;
    }

    function claim(address user) external onlyOwner override {
        uint256 amount = balances[user];
        require(amount != 0, "NothingToWithdraw");
        balances[user] = 0;
        poolToken.transfer(user, amount + bonus);
    }

    function participantsLength() external override view returns(uint256) {
        return participants.length;
    }
}
